script: |
  super -f text -I q9304.spq | sort > q9304.out

inputs:
  - name: q9304.spq
    data: |
      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + + 33 < NULL OR NOT 32 + 79 IN ( - col1 / 52 + - - 84 + - - 58 + - - col0 * - - 99 );
  - name: tab0

outputs:
  - name: q9304.out
    data: |
      10
      47
      99
